import Header from './components/Header'
import Main from './components/Main'
import Nav from './components/Nav'

import logo from './logo.svg';
import './App.css';








class App extends Component {
  render() {
    return(
      <div className="App">
        <Header></Header>
        <Nav></Nav>
        <Main></Main>
      </div>
    )

  }
}

export default App;
